    style='font-size:16.0pt;mso-bidi-font-size:11.0pt;line-height:107%;
    mso-ansi-language:ES-SV'>Hablar de energías renovables implica tener que
    hacer referencia a una de las más antiguas: la eólica. Se trata de la
    energía que se obtiene del viento a través de un generador eólico,
    caracterizada por ser inagotable, no contaminante y que contribuye a la
    reducción del uso de combustibles fósiles causantes de los gases de efecto
